import React from 'react';
import logo from './Logo_vjn.png';
import './App.css';
import Social from './components/socialmedia/Social';
import About from './components/text/About';
import Contact from './components/text/Contact';
import Project from './components/text/Project';
import Resume from './components/text/Resume';
import Myskills from './components/text/Myskills';

function App() {
  return (
    <div className="App">


        <div className='green'>
          <img src={logo} className='Logo' />
        </div>

        <div className='yellow'>
          <Contact/>
        </div>


      <div className='row3'>


          <div className='about'>
            <About/>
          </div>
          <div className='blue'>
            <Social className="social_blue" />
          </div>




          <div className='row2'>
            <div className='purple'></div>
            <div className='red'>
              <Project/>
              <br /><br /><br /><br /><br /><br />
              <Resume/>
            </div>
          </div>

          <div className='pink'>
            <Myskills/>
          </div>

      </div>


    </div>
  );
}

export default App;
